import React from "react";

function Contact() {
  return (
    <div>
      <h1 className="display-3 text-center text-white">CONTACT US</h1>
      <p className="lead text-center text-white">Mobile: 03041286524</p>
      <br />
      <p>
        {" "}
        <p className="lead text-center text-white">
          Email: uzairmaan2@gmail.com
        </p>
        <p className="lead text-center text-white">Office Time: Mon to Sun</p>
      </p>
    </div>
  );
}

export default Contact;
